To create a web application using React, Node.js, and Express.js, you'll need to set up a few things. Here's a step-by-step guide:

1. Set up the project structure:

Create a new directory for your project and navigate into it:
```
mkdir my-app
cd my-app
```

2. Set up the backend with Node.js and Express.js:

Initialize a new Node.js project and install Express.js:
```
npm init -y
npm install express
```

Create a new file called `server.js` and add the following code:
```javascript
const express = require('express');
const app = express();
const port = process.env.PORT || 5000;

app.use(express.json());

// Add your routes here

app.listen(port, () => {
  console.log(`Server is running on port ${port}`);
});
```

3. Set up the frontend with React:

Create a new React app using `create-react-app`:
```
npx create-react-app client
```

Navigate into the `client` directory and install Axios to make HTTP requests:
```
cd client
npm install axios
```

4. Create components and add dummy data:

In the `client/src` directory, create a new component called `DummyData.js` and add the following code:
```javascript
import React, { useState } from 'react';
import axios from 'axios';

const DummyData = () => {
  const [data, setData] = useState([]);

  const addData = async () => {
    const response = await axios.post('/api/data', {
      // Add your dummy data here
    });
    setData([...data, response.data]);
  };

  return (
    <div>
      <button onClick={addData}>Add Dummy Data</button>
      {data.map((item, index) => (
        <div key={index}>
          {/* Display your data here */}
        </div>
      ))}
    </div>
  );
};

export default DummyData;
```

5. Add routes to the backend:

In `server.js`, add the following code to handle the `/api/data` route:
```javascript
app.post('/api/data', (req, res) => {
  const data = req.body;
  // Add your data to a database or store it in memory
  res.json(data);
});
```

6. Build and deploy the app:

First, build the React app:
```
cd client
npm run build
```

This will create a `build` directory with the production-ready code.

Next, copy the contents of the `build` directory to the root directory of your project:
```
cp -R build/* .
```

Finally, add the following code to `server.js` to serve the static files:
```javascript
app.use(express.static('build'));

app.get('*', (req, res) => {
  res.sendFile(path.resolve(__dirname, 'build', 'index.html'));
});
