Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.textFile("onsite_data.txt")
      .map(line => line.split("\t"))
      .map(arr => (arr(0), arr(1).toLong))

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.sparkContext.textFile("top_queries.txt")

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, (Long, Int)] = Map()

    // Process onsite data
    val hitRate = onsiteData.map(record => {
      val query = record._1
      val timestamp = record._2

      // Check if query is in top queries
      if (broadcastTopQueries.value.contains(query)) {
        // Check if query is in cache
        if (cache.contains(query)) {
          val (lastAccessTime, hitCount) = cache(query)

          // Check if query is still in cache
          if (timestamp - lastAccessTime <= 12 * 60 * 60) {
            // Update hit count
            cache(query) = (timestamp, hitCount + 1)

            // Return true for hit
            true
          } else {
            // Remove query from cache
            cache.remove(query)

            // Return false for miss
            false
          }
        } else {
          // Add query to cache
          cache(query) = (timestamp, 1)

          // Return false for miss
          false
        }
      } else {
        // Return false for miss
        false
      }
    }).countByValue()

    // Calculate hit rate
    val totalQueries = onsiteData.count()
    val totalHits = hitRate.getOrElse(true, 0L)
    val hitRate = totalHits.toDouble / totalQueries.toDouble

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries into JavaRDDs. It then broadcasts the top frequent queries to all nodes using the `broadcast` function.

Next, it initializes a cache using a mutable map to store the queries and their last access time and hit count. It then processes the onsite data by checking if each query is in the top frequent queries and if it is in the cache. If it is in the cache and the last access time is within the 12-hour window, it increments the hit count and returns true for a hit. If it is not in the cache or the last access time is outside the 12-hour window, it adds the query to the cache and returns false for a miss.

Finally, it calculates the hit rate by counting the number of hits and dividing it by the total number of queries. The hit rate is then printed to the console.

