Adaptive Cards in Microsoft Teams do not directly support changing the background color of the entire card. However, you can change the background color of individual elements within the card, such as containers or columns.

Here's an example of how to change the background color of a container within an Adaptive Card:
```json
{
    "type": "AdaptiveCard",
    "body": [
        {
            "type": "Container",
            "style": "emphasis",
            "items": [
                {
                    "type": "TextBlock",
                    "text": "This is a container with a background color"
                }
            ],
            "backgroundImage": {
                "url": "data:image/png;base64,iVBORw0KGg...."
            }
        }
    ],
    "actions": [],
    "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
    "version": "1.0"
}
```
In the above example, the `backgroundImage` property is used to set the background color of the container. The value of the `url` property is a base64-encoded string of a 1x1 pixel image with the desired background color.

To generate the base64-encoded string, you can use an online tool such as [this one](https://www.base64-image.de/). Simply upload a 1x1 pixel image with the desired background color, and the tool will generate the base64-encoded string for you.

Once you have the base64-encoded string, you can replace the `iVBORw0KGg....` placeholder in the above example with your own string.

Note that this method only works for containers and columns within an Adaptive Card, and not for the entire card itself. If you need to change the background color of the entire card, you may need to consider using a different type of card or a custom solution.

To create a tooltip in NextJS using React Context to close the previously opened tooltip, you can follow these steps:

1. Create a Tooltip Context:

First, create a context for the tooltip component. This context will be used to manage the state of the tooltip and provide a way to close the previously opened tooltip.

```jsx
import React from 'react';

const TooltipContext = React.createContext();

export default TooltipContext;
```

2. Create a Tooltip Provider:

Next, create a provider component that will wrap the tooltip components and provide the context to them. This provider component will manage the state of the tooltip and provide a way to close the previously opened tooltip.

```jsx
import React, { useState } from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, closeTooltip, openTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```

3. Create a Tooltip Component:

Now, create a tooltip component that will use the context to manage its state and close the previously opened tooltip.

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ id, children }) => {
  const { activeTooltip, closeTooltip, openTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    if (activeTooltip !== id) {
      closeTooltip();
      openTooltip(id);
    }
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {activeTooltip === id && (
        <div className="tooltip">
          {/* Tooltip content goes here */}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

4. Use the Tooltip Provider and Component:

Finally, use the tooltip provider and component in your NextJS application.

```jsx
import React from 'react';
import TooltipProvider from './TooltipProvider';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip id="tooltip1">
          Hover over me
        </Tooltip>
        <Tooltip id="tooltip2">
          Hover over me
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

In this example, the `TooltipProvider` component wraps the `Tooltip` components and provides the context to them. The `Tooltip` component uses the context to manage its state and close the previously opened tooltip. When the user hovers over a tooltip, the `handleMouseEnter` function is called, which checks if the active tooltip is not the current tooltip and closes the active tooltip before opening the current tooltip. When the user moves the mouse away from the tooltip, the `handleMouseLeave` function is called, which closes the active tooltip.

