Static variables and register variables are two types of variables in C programming language.

1. Static Variables:
Static variables are variables that retain their value between function calls. They are declared using the keyword "static" and are initialized only once. They have a default value of zero if not explicitly initialized. Static variables are stored in the data segment of the program's memory and have a lifetime that is the same as the program's lifetime.

Here is an example of a static variable:
```c
#include <stdio.h>

void increment() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
```
In this example, the variable "count" is declared as static inside the function "increment". The value of "count" is retained between function calls, and it is incremented each time the function is called.

2. Register Variables:
Register variables are variables that are stored in the CPU's register instead of the program's memory. They are declared using the keyword "register" and are used for frequently accessed variables to improve performance. However, the use of register variables is not guaranteed, and it is up to the compiler to decide whether to store the variable in a register or not.

